LearningGoal.create!([
  {nombre: "17", descripcion: "Comprender y disfrutar versiones completas de obras de la literatura, narradas o leídas por un adulto, como: cuentos folclóricos y de autor, poemas, fábulas, leyendas.", assignature_id: 1, level_id: 1},
  {nombre: "19", descripcion: "Desarrollar la curiosidad por las palabras o expresiones que desconocen y adquirir el hábito de averiguar su significado.", assignature_id: 1, level_id: 1},
  {nombre: "11", descripcion: "Desarrollar el gusto por la lectura, explorando libros y sus ilustraciones.", assignature_id: 1, level_id: 1},
  {nombre: "12", descripcion: "Asistir habitualmente a la biblioteca para elegir, escuchar, leer y explorar textos de su interés.", assignature_id: 1, level_id: 1},
  {nombre: "15", descripcion: "Escribir con letra clara, separando las palabras con un espacio para que puedan ser leídas por otros con facilidad.", assignature_id: 1, level_id: 1},
  {nombre: "16", descripcion: "Incorporar de manera pertinente en la escritura el vocabulario nuevo extraído de textos escuchados o leídos.", assignature_id: 1, level_id: 1},
  {nombre: "24", descripcion: "Incorporar de manera pertinente en sus intervenciones orales el vocabulario nuevo extraído de textos escuchados o leídos.", assignature_id: 1, level_id: 1},
  {nombre: "21", descripcion: "articipar activamente en conversaciones grupales sobre textos leídos o escuchados en clases o temas de su interés: expresando sus ideas u opiniones, demostrando interés ante lo escuchado y respetando turnos.", assignature_id: 1, level_id: 1},
  {nombre: "22", descripcion: "Interactuar de acuerdo con las convenciones sociales en diferentes situaciones: presentarse a sí mismo y a otros, saludar, preguntar, expresar opiniones, sentimientos e ideas; situaciones que requieren el uso de fórmulas de cortesía como por favor, gracias, perdón, permiso.", assignature_id: 1, level_id: 1},
  {nombre: "01", descripcion: "Reconocer que los textos escritos transmiten mensajes y que son escritos por alguien para cumplir un propósito.", assignature_id: 1, level_id: 1},
  {nombre: "02", descripcion: "Reconocer que las palabras son unidades de significado separadas por espacios en el texto escrito.", assignature_id: 1, level_id: 1},
  {nombre: "03", descripcion: "Identificar los sonidos que componen las palabras (conciencia fonológica), reconociendo, separando y combinando sus fonemas y sílabas.", assignature_id: 1, level_id: 1},
  {nombre: "04", descripcion: "Leer palabras aisladas y en contexto, aplicando su conocimiento de la correspondencia letra-sonido en diferentes combinaciones: sílaba directa, indirecta o compleja y dígrafos rr-ll-ch-qu.", assignature_id: 1, level_id: 1},
  {nombre: "05", descripcion: "Leer textos breves en voz alta para adquirir fluidez: pronunciando cada palabra con precisión, aunque se autocorrijan en algunas ocasiones; respetando el punto seguido y el punto aparte, y leyendo palabra a palabra.", assignature_id: 1, level_id: 1},
  {nombre: "13", descripcion: "Experimentar con la escritura para comunicar hechos, ideas y sentimientos, entre otros.", assignature_id: 1, level_id: 1},
  {nombre: "18", descripcion: "Comprender textos orales (explicaciones, instrucciones, relatos, anécdotas, etc.) para obtener información y desarrollar su curiosidad por el mundo: estableciendo conexiones con sus propias experiencias; visualizando lo que se describe en el texto; formulando preguntas para obtener información adicional y aclarar dudas; respondiendo preguntas abiertas; formulando una opinión sobre lo escuchado.", assignature_id: 1, level_id: 1},
  {nombre: "26", descripcion: "Recitar con entonación y expresión poemas, rimas, canciones, trabalenguas y adivinanzas para fortalecer la confianza en sí mismos, aumentar el vocabulario y desarrollar su capacidad expresiva.", assignature_id: 1, level_id: 1},
  {nombre: "06", descripcion: "Comprender textos aplicando estrategias de comprensión lectora; por ejemplo: relacionar la información del texto con sus experiencias y conocimientos; visualizar lo que describe el texto.", assignature_id: 1, level_id: 1},
  {nombre: "07", descripcion: "Leer independientemente y familiarizarse con un amplio repertorio de literatura para aumentar su conocimiento del mundo y desarrollar su imaginación; por ejemplo: poemas, historias breves, textos con una estructura predecible.", assignature_id: 1, level_id: 1},
  {nombre: "08", descripcion: "Demostrar comprensión de narraciones que aborden temas que les sean familiares: extrayendo información explícita e implícita; respondiendo preguntas simples, oralmente o por escrito, sobre los textos (qué, quién, dónde, cuándo, por qué); recreando personajes a través de distintas expresiones artísticas, como títeres, dramatizaciones, dibujos o esculturas; describiendo con sus palabras las ilustraciones del texto y relacionándolas con la historia; estableciendo relaciones entre el texto y sus propias experiencias; emitiendo una opinión sobre un aspecto de la lectura.", assignature_id: 1, level_id: 1},
  {nombre: "09", descripcion: "Leer habitualmente y disfrutar los mejores poemas de autor y de la tradición oral adecuados a su edad.", assignature_id: 1, level_id: 1},
  {nombre: "10", descripcion: "Leer independientemente y comprender textos no literarios escritos con oraciones simples (cartas, notas, instrucciones y artículos informativos) para entretenerse y ampliar su conocimiento del mundo: extrayendo información explícita e implícita, formulando una opinión sobre algún aspecto de la lectura.", assignature_id: 1, level_id: 1},
  {nombre: "14", descripcion: "Escribir oraciones completas para transmitir mensajes.\r\n", assignature_id: 1, level_id: 1},
  {nombre: "23", descripcion: "Expresarse de manera coherente y articulada sobre temas de su interés: presentando información o narrando un evento relacionado con el tema; incorporando frases descriptivas que ilustren lo dicho; utilizando un vocabulario variado; pronunciando adecuadamente y usando un volumen audible; manteniendo una postura adecuada.", assignature_id: 1, level_id: 1},
  {nombre: "20", descripcion: "Disfrutar de la experiencia de asistir a obras de teatro infantiles o representaciones para ampliar sus posibilidades de expresión, desarrollar su creatividad y familiarizarse con el género.", assignature_id: 1, level_id: 1},
  {nombre: "25", descripcion: "Desempeñar diferentes roles para desarrollar su lenguaje y autoestima, y aprender a trabajar en equipo.", assignature_id: 1, level_id: 1},
  {nombre: "01", descripcion: "", assignature_id: 2, level_id: 2}
])

