corte</a></li>\n          <li><a href=\"#\"><i class=\"fa fa-circle-o text-orange\"></i> Ingreso resultados</a></li>\n          <li><a href=\"/instruments\"><i class=\"fa fa-circle-o text-orange\"></i> Descarga evaluaciones</a></li>\n        </ul>\n      </li>\n    </ul>\n  </section>\n  <!-- /.sidebar -->\n\n</aside>\n\n\n      </div>\n      <div class=\"content-wrapper\" height='100%'>\n        <meta charset=\"utf-8\" />\n<br>\n\n<p align='center' style=\"font-size:125%;\"><b>EVALUACION DE PRUEBA 2</br>\n  LENGUAJE Y COMUNICACION</br>\nPRIMERO BASICO</p></b>\n<font size =\"3\">\n  <table>\n    <tr>\n      <td width=\"80%\">Nombre:_______________________________________________ &nbsp;</td><td width=\"20%\">Curso:_________</td>\n    </tr>\n\n  </table>\n\n  <table>\n    <tr>\n      <td width=\"40%\">Puntaje Máximo: _________________&nbsp; </td><td width=\"30%\">Puntaje Obtenido: ________&nbsp; </td><td width=\"30%\"> Nota: ______</td>\n    </tr>\n  </table>\n  <br>\n  <p>\n    <u>INSTRUCCIONES:</u>\n  <ul>\n    <li>\n      Lee con atención cada uno de los textos y luego encierra la alternativa que estimes\n      correcta en cada pregunta.\n    </li>\n\n  </ul>\n  </p>\n<br>\n<div style=\"page-break-inside: avoid;\">\n  <div>\n    <p>1. El texto anterior corresponde a:</p>\n  </div>\n  <br>  \n  <div style=\"line-height: 50%;\">\n    <div>  \n      <p>     A) Un cuento.</p>\n    </div>\n    <div>  \n      <p>     B) Una fábula.</p>\n    </div>\n    <div>  \n      <p>     C) Una leyenda.</p>\n    </div>\n    <div>  \n      <p>     D) Un poema.</p>\n    </div>\n  </div>\n</div>\n<br>\n<div style=\"page-break-inside: avoid;\">\n  <div>\n    <p>2. El ratón de campo invitó a su primo, porque:</p>\n  </div>\n  <br>  \n  <div style=\"line-height: 50%;\">\n    <div>  \n      <p>     A) La comida era mejor.</p>\n    </div>\n    <div>  \n      <p>     B) Habían menos gatos.</p>\n    </div>\n    <div>  \n      <p>     C) Quería conocer el campo.</p>\n    </div>\n    <div>  \n      <p>     D) Estarían más tranquilos.</p>\n    </div>\n  </div>\n</div>\n<br>\n<div style=\"page-break-inside: avoid;\">\n  <div>\n    <p>3. Según el texto, ¿qué podríamos encontrar en el campo?</p>\n  </div>\n  <br>  \n  <div style=\"line-height: 50%;\">\n    <div>  \n      <p>     A) Gatos.</p>\n    </div>\n    <div>  \n      <p>     B) Comida.</p>\n    </div>\n    <div>  \n      <p>     C) Tranquilidad.</p>\n    </div>\n    <div>  \n      <p>     D) Suciedad.</p>\n    </div>\n  </div>\n</div>\n<br>\n<div style=\"page-break-inside: avoid;\">\n  <div>\n    <p>4. En la oración, “El ratón de <strong><u>ciudad</u></strong> huyó rápidamente, seguido por su primo que no sabía dónde esconderse”, la palabra destacada corresponde a:</p>\n  </div>\n  <br>  \n  <div style=\"line-height: 50%;\">\n    <div>  \n      <p>     A) Una palabra esdrújula.</p>\n    </div>\n    <div>  \n      <p>     B) Una palabra con un diptongo.</p>\n    </div>\n    <div>  \n      <p>     C) Una palabra grave.</p>\n    </div>\n    <div>  \n      <p>     D) Una palabra que tiene un hiato.</p>\n    </div>\n  </div>\n</div>\n<br>\n<div style=\"page-break-inside: avoid;\">\n  <div>\n    <p>5. Según el texto, el leñador se puede caracterizar como una persona:</p>\n  </div>\n  <br>  \n  <div style=\"line-height: 50%;\">\n    <div>  \n      <p>     A) Ansiosa.</p>\n    </div>\n    <div>  \n      <p>     B) Reflexiva.</p>\n    </div>\n    <div>  \n      <p>     C) Indecisa.</p>\n    </div>\n    <div>  \n      <p>     D) Intolerante.</p>\n    </div>\n  </div>\n</div>\n<br>\n<div style=\"page-break-inside: avoid;\">\n  <div>\n    <p>6. En la oración: “Me gustaría comer una salchicha grande”, la palabra destacada tiene</p><p>la función de:</p>\n  </div>\n  <br>  \n  <div style=\"line-height: 50%;\">\n    <div>  \n      <p>     A) Determinar si es femenino o masculino el sustantivo.</p>\n    </div>\n    <div>  \n      <p>     B) Señalar una acción.</p>\n    </div>\n    <div>  \n      <p>     C) Dar una característica del sustantivo.</p>\n    </div>\n    <div>  \n      <p>     D) Nombrar cosas.</p>\n    </div>\n  </div>\n</div>\n<br>\n<div style=\"page-break-inside: avoid;\">\n  <div>\n    <p>7. En la frase: “El duende agradecido” , la definición de la palabra destacada es:</p>\n  </div>\n  <br>  \n  <div style=\"line-height: 50%;\">\n    <div>  \n      <p>     A) Felicitación por algo bien hecho.</p>\n    </div>\n    <div>  \n      <p>     B) Ser amistoso.</p>\n    </div>\n    <div>  \n      <p>     C) Entregar un obsequio.</p>\n    </div>\n    <div>  \n      <p>     D) Gratitud por algo recibido.</p>\n    </div>\n  </div>\n</div>\n<br>\n</font>\n\n      </div>\n\n      <footer class=\"main-footer\">\n        <strong>© 2015 <a href=\"http://www.reimagina.cl\">Reimagina Educación</a>.</strong> Sistema Unificado Reimagina Versión 1.0.0\n      </footer>\n    </div>\n  </body>\n\n\n</html>\n\n"},
